import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { RiCheckboxCircleLine, RiArrowRightLine, RiArrowLeftLine } from "react-icons/ri";
import { motion } from "framer-motion";

const KEY_STEP1 = "dk_kyc_step1_docType";
const KEY_STEP2 = "dk_kyc_step2_docNumber";
const KEY_STEP3 = "dk_kyc_step3_docType";

export default function KYCStep5() {
  const navigate = useNavigate();
  const [docType, setDocType] = useState("");
  const [docNumber, setDocNumber] = useState("");
  const [uploadedDocType, setUploadedDocType] = useState("");
  const [status, setStatus] = useState("Under verification"); // could be: Under verification | Verified | Action required
  const [etaMinutes, setEtaMinutes] = useState(10); // friendly estimate shown to user

  useEffect(() => {
    try {
      setDocType(localStorage.getItem(KEY_STEP1) || localStorage.getItem(KEY_STEP3) || "—");
      setDocNumber(localStorage.getItem(KEY_STEP2) || "—");
      setUploadedDocType(localStorage.getItem(KEY_STEP3) || localStorage.getItem(KEY_STEP1) || "—");
    } catch {
      // ignore storage errors
    }
  }, []);

  // Small UX timer that gently reduces ETA to feel responsive (client-only; not authoritative)
  useEffect(() => {
    const t = setInterval(() => {
      setEtaMinutes((m) => (m > 1 ? m - 1 : 0));
    }, 60_000); // every minute
    return () => clearInterval(t);
  }, []);

  const handleFinish = () => {
    // Clear KYC keys optionally (keep for audit if needed)
    try {
      // localStorage.removeItem(KEY_STEP1);
      // localStorage.removeItem(KEY_STEP2);
      // localStorage.removeItem(KEY_STEP3);
    } catch {}
    navigate("/dashboard");
  };

  const handleBack = () => navigate("/kyc-step4");
  const handleViewSubmission = () => navigate("/kyc-step4"); // goes back to review; extend to a submission details page if available

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-50 to-white p-6">
      <motion.section
        initial={{ opacity: 0, y: 12 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.45 }}
        className="w-full max-w-lg bg-white p-8 rounded-2xl shadow-2xl border border-gray-100"
        aria-labelledby="kyc-step5-title"
      >
        <div className="flex items-center justify-between mb-6">
          <div>
            <div className="text-sm text-slate-500">Step <span className="font-semibold">5</span> of <span className="font-semibold">5</span></div>
            <h2 id="kyc-step5-title" className="text-2xl font-extrabold text-slate-800">KYC submitted</h2>
            <p className="mt-1 text-sm text-slate-500">We've received your documents — sit tight while our verification engine checks them.</p>
          </div>

          <div className="w-40 text-right">
            <div className="w-full bg-slate-100 h-2 rounded-full overflow-hidden">
              <div className="h-2 rounded-full bg-blue-600" style={{ width: "100%" }} />
            </div>
            <div className="text-xs text-slate-400 mt-2">Progress: 100%</div>
          </div>
        </div>

        <div className="flex flex-col items-center gap-4 mb-6">
          <RiCheckboxCircleLine className="text-green-500 text-6xl" aria-hidden />
          <div className="text-lg font-semibold text-slate-800">{status}</div>
          <p className="text-sm text-slate-500 text-center max-w-md">
            Typical verification time ~ <span className="font-medium">{etaMinutes} {etaMinutes === 1 ? "minute" : "minutes"}</span>. We'll notify you when the status changes.
          </p>
        </div>

        <dl className="grid grid-cols-1 gap-3 mb-6">
          <div className="p-4 rounded-lg border border-slate-100 bg-slate-50">
            <dt className="text-xs text-slate-500">Document type</dt>
            <dd className="mt-1 font-medium text-slate-800">{docType || "—"}</dd>
          </div>

          <div className="p-4 rounded-lg border border-slate-100 bg-slate-50">
            <dt className="text-xs text-slate-500">Document number</dt>
            <dd className="mt-1 font-medium text-slate-800">{docNumber ? (String(docNumber).replace(/(.{4}).+(.{4})/, "$1XXXX$2")) : "—"}</dd>
          </div>

          <div className="p-4 rounded-lg border border-slate-100 bg-slate-50">
            <dt className="text-xs text-slate-500">Uploaded file</dt>
            <dd className="mt-1 font-medium text-slate-800">{uploadedDocType || "—"}</dd>
          </div>
        </dl>

        <div className="flex gap-3">
          <button
            type="button"
            onClick={handleBack}
            className="flex items-center gap-2 px-4 py-2 rounded-lg border border-slate-200 text-sm bg-white hover:shadow-sm focus:outline-none focus:ring-2 focus:ring-slate-200"
          >
            <RiArrowLeftLine /> Back
          </button>

          <button
            type="button"
            onClick={handleViewSubmission}
            className="inline-flex items-center gap-2 px-4 py-2 rounded-lg border border-slate-200 text-sm bg-white hover:shadow-sm focus:outline-none focus:ring-2 focus:ring-slate-200"
          >
            View submission
          </button>

          <button
            type="button"
            onClick={handleFinish}
            className="ml-auto inline-flex items-center gap-2 px-5 py-3 rounded-lg bg-blue-700 text-white font-medium shadow hover:opacity-95 focus:outline-none focus:ring-2 focus:ring-blue-300"
          >
            Finish <RiArrowRightLine />
          </button>
        </div>

        <p className="mt-4 text-xs text-slate-400">
          We process documents securely. If additional information is needed we will contact you via the registered email/phone.
        </p>
      </motion.section>
    </div>
  );
}
